- input: "TEXT\x1CC00277541\x1CX0\x1C\x1CF3XA\x1CThe Fairfax County Democratic Committee
    employs one full time employee, the Executive Director, whose time was more than
    25 percent devoted to federal elections and candidates during this reporting period.
    \ No other entity pays compensation for their employees to work for the Committee.
    The Committee does not engage in any fundraising on behalf of candidates for Federal
    office, so all of its reported fundraising expenses are party fundraising. The
    Committee maintains both Federal and Non Federal accounts.  The Committee is allocating
    administrative expenses using the 64% - 36% split this year.  The amendment was
    made to add a contribution $40 contribution that had been inadvertently deleted
    from our database.  This amendment adds memos to certain disbursements for federal
    election activity to clarify that they are public communications that refer to
    clearly identified candidates for Federal office and identifies the candidates
    benefitted.  All of these disbursements met the conditions of exempt activity.
    \ The amendment also makes changes to schedule H4 to correct for errors resulting
    from a software glitch that had the result of allocating administrative expenditures
    as 0 percent Federal/100% nonfederal rather than using the 36%/64% split required.\n"
